import io
import cv2
import numpy as np
import base64
import dlib


lines_cheek_right = [
    (1, 36),
    (36, 41),
    (41, 40),
    (40, 39),
    (39, 31),
    (31, 48),
    (48, 5),
    (5, 4),
    (4, 3),
    (3, 2),
    (2, 1),
]

lines_cheek_left = [
    (15, 45),
    (45, 46),
    (46, 47),
    (47, 42),
    (42, 35),
    (35, 54),
    (54, 11),
    (11, 12),
    (12, 13),
    (13, 14),
    (14, 15),
]


class FaceMesh:
    def __init__(self, thickness=1, circle_radius=1):
        self.detector = dlib.get_frontal_face_detector()
        self.predictor = dlib.shape_predictor("shape_predictor_68_face_landmarks.dat")

        return

    def loadImage(self, file_name):
        image = cv2.imread(file_name)
        return image

    def saveImage(self, image, file_name, ext="png"):
        cv2.imwrite(file_name + "." + ext, image)
        return

    def base64ToImage(self, data):
        data = data.encode()
        image_data = base64.decodebytes(data)

        image_stream = io.BytesIO()
        image_stream.write(image_data)
        image_stream.seek(0)

        file_bytes = np.asarray(bytearray(image_stream.read()), dtype=np.uint8)
        img = cv2.imdecode(file_bytes, cv2.IMREAD_COLOR)

        return img

    def imageToBase64(self, image):
        retval, temp = cv2.imencode(".jpg", image)
        data = base64.b64encode(temp)
        return data

    def drawLine(self, image, point, lines):
        for s, e in lines:
            cv2.line(image, (point(s).x, point(s).y), (point(e).x, point(e).y), 2)

        return image

    def run(self, data):
        # For static images:
        image = self.base64ToImage(data)

        # Convert the BGR image to RGB before processing.
        img = cv2.cvtColor(image, cv2.COLOR_BGR2RGB)

        rects = self.detector(img, 1)
        if rects:
            for i, rect in enumerate(rects):
                shape = self.predictor(img, rect)
                for j in range(68):
                    x, y = shape.part(j).x, shape.part(j).y
                    cv2.putText(image, str(j), (x, y), 0, 1, (0, 0, 255))
                    cv2.circle(image, (x, y), 1, (0, 0, 255), -1)
                image = self.drawLine(image, shape.part, lines_cheek_right)

            self.saveImage(image, "result_dlib")
            base64_data = self.imageToBase64(image)
            return base64_data

        else:
            print("Not find face mesh")


if __name__ == "__main__":
    face_mesh = FaceMesh()
    res = face_mesh.run(
        " "
    )
